package com.servinglynk.hmis.warehouse.core.model.exception;@SuppressWarnings("serial")public class InvalidTrustedAppException extends RuntimeException {	/**	 * Default exception message	 */	public static final String DEFAULT_MESSAGE = "invalid TrustedApp type";	public InvalidTrustedAppException() {		super(DEFAULT_MESSAGE);	}	public InvalidTrustedAppException(String message) {		super(message);	}	public InvalidTrustedAppException(Throwable cause) {		super(DEFAULT_MESSAGE, cause);	}	public InvalidTrustedAppException(String message, Throwable cause) {		super(message, cause);	}}